const puppeteer = require('puppeteer');
const urlModule = require('url');
const fs = require('fs');
const fastcsv = require('fast-csv');

async function checkWebsite(website) {
    let error = null;
    let linkExists = false;
    try {
        const browser = await puppeteer.launch({ headless: "new" }); // Change is here
        const page = await browser.newPage();
        await page.goto(website.url, { waitUntil: 'networkidle0' });

        const anchors = await page.evaluate(() => Array.from(document.querySelectorAll('a'), a => ({ href: a.href, text: a.textContent })));

        const normalizedBacklink = normalizeUrl(website.backlink);

        linkExists = anchors.some(a => {
            const normalizedHref = normalizeUrl(a.href);
            return normalizedHref === normalizedBacklink && a.text.includes(website.keyword);
        });

        await browser.close();
    } catch (err) {
        error = err.toString();
    }

    return { linkExists, error };
}

function normalizeUrl(url) {
    const parsed = urlModule.parse(url);

    if (parsed.pathname) {
        if (!parsed.pathname.endsWith('/') && !parsed.pathname.includes('.')) {
            parsed.pathname += '/';
        }

        if (parsed.pathname.endsWith('/') && parsed.pathname.includes('.')) {
            parsed.pathname = parsed.pathname.slice(0, -1);
        }
    }

    return urlModule.format(parsed);
}


